const Lisor = {
    _lisorCounter: 0,
    _lisorGif: "data:image/gif;base64,",
    _isRunning: false,

    start: () => {
        addEventListener('keyup', (e) => {
            if (Lisor._isRunning) {
                return;
            }

            if ((e.key === 'l' || e.key === 'L') && Lisor._lisorCounter === 0) {
                Lisor._lisorCounter++;
            } else if ((e.key === 'i' || e.key === 'I') && Lisor._lisorCounter === 1) {
                Lisor._lisorCounter++;
            } else if ((e.key === 's' || e.key === 'S') && Lisor._lisorCounter === 2) {
                Lisor._lisorCounter++;
            } else if ((e.key === 'o' || e.key === 'O') && Lisor._lisorCounter === 3) {
                Lisor._lisorCounter++;
            } else if (e.key === 'r' || e.key === 'R') {
                Lisor._lisorCounter++;
            } else {
                Lisor._lisorCounter = 0;
            }

            if (Lisor._lisorCounter === 5) {
                Lisor._lisorCounter = 0;
                Lisor._showLisor();
            }
        });
    },

    _showLisor: () => {
        Lisor._isRunning = true;
        let lisor = document.createElement('img');
        lisor.src = Lisor._lisorGif;
        lisor.style.position = 'fixed';
        lisor.style.bottom = '0';
        lisor.style.left = '-20dvw';
        lisor.style.zIndex = '1000';
        lisor.style.maxWidth = '20dvw';
        lisor.style.maxHeight = '15dvh';
        lisor.style.transition = `left ${window.innerWidth / 150}s`;
        lisor.style.transitionTimingFunction = 'linear';
        document.body.appendChild(lisor);
        setTimeout(() => {
            lisor.style.left = '100%';
            setTimeout(() => {
                lisor.remove();
            }, (window.innerWidth / 150) * 1000);
        }, 100);
    }
}

export default Lisor;